import React from "react";

function Skills() {
  return (
    <div>
      <div className="breathe colorSwitch">
        <h2 id="skills" style={{ marginTop: "-100px", marginBottom: "25px" }}>
          Tech Chops
        </h2>
        <div className="row">
          <div className="column3">
            <div className="card3 container2">
              <h4>Front End</h4>
              <div className="overlay">
                <div className="text">
                  <p>HTML5 - CSS3 - React.js - Anime.js</p>
                </div>
              </div>
            </div>
          </div>
          <div className="column3">
            <div className="card3 container2">
              <h4>Back End</h4>
              <div className="overlay">
                <div className="text">
                  <p>Express - Knex - SQL - PostgreSQL</p>
                </div>
              </div>
            </div>
          </div>
        </div>
        <div className="row">
          <div className="column3">
            <div className="card3 container2">
              <h4>Misc. Tech Stuff</h4>
              <div className="overlay">
                <div className="text">
                  <p>Mocha - Chai - Cors - Git - GitHub - Node.js</p>
                </div>
              </div>
            </div>
          </div>
          <div className="column3">
            <div className="card3 container2">
              <h4>Other Skills</h4>
              <div className="overlay">
                <div className="text">
                  <p>Express - Knex - SQL - PostgreSQL</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Skills;

